import React from 'react'

const Cell = ({cellState}) => {
    console.log(cellState);
    if (cellState === 0) {
        return <div className='gamecell'> this is a game cell</div>
    }
    if (cellState === 1) {
        return <div className='gamecell'> this is a game cell</div>
    }
    if (cellState === 2) {
        return <div className='gamecell'> this is a game cell</div>
    }
}

export default Cell;
